export default function CreatedApplicationList({ sentApplications }) {
  return (
    <div className="">
      <p>My Applications List</p>
      <div>
        {sentApplications.map((cur) => (
          <SentApplicationList profName={sentApplications} />
        ))}
      </div>
    </div>
  );
}

function SentApplicationList({ props, project, status, decision }) {
  return (
    <div>
      {props.profName}
      <br />
      {props.department}
    </div>
  );
}
